description:
Return Address Stamps, Custom Rubber Stamps, Personalized Monogram Stamps, Save the Date Stamps, Business Card Stamps, Etsy Shop  Stamps for Business Cards and Shop Packaging, Wedding Invitation Stamps!

You may choose ONE of the following:
• Handle Mount/No Ink (Ink pad not included)
• Handle with Ink Pad (Black, Red, Blue)
• Self Inking with built-in ink pad (Black, Red, Blue)

This stamp is approximately 2.5&quot; x 1&quot; or smaller depending on the length of the name(s) and address display

{ HOW TO ORDER }
1) Select your stamp type; &#39;Mount Handle / Self Inking&#39; 
2) Enter your stamp details in &#39;Add your personalization&#39;
3) Select &#39;Quantity&#39;
4) Click on &#39;Add to cart&#39;
5) Proceed to payment

{ PROOFS }
UNLIMITED PROOFS and NO EXTRA CHARGES when you change to a new design! We will make a proof using the details you&#39;ve provided and send it to you via ETSY convo for your approval. Please review the proof and send approval back to us. Your stamp will only be made after we&#39;ve received your approval. Please allow 2-3 business days for stamp production. 

{ DIGITAL ARTWORK }
Digital file ONLY without physical self-inking stamp
Upon your approval, the digital file; JPEG file and Adobe Illustrator file (vector file) will be emailed to you. You can print it at home or send to a printer vendor

{ SHIPPING POLICY }
Standard Shipping: 12-15 business days

Delivery time frame is just an estimation by the courier company (excluding public holidays and weekends). It is not a guarantee delivery and still depends on the custom clearance and weather conditions. We are not responsible for any delivery delays.

Shipping address will be the address appeared in your Etsy order/receipt.

Thank you! Happy Shopping!

🌿 Item Overview: 
This listing is for ONE CUSTOM WHITE AND GOLD CALLIGRAPHY GLOBE WITH SHADED CONTINENTS, WITH CHOICE OF INK COLOR (see drop down menu for pricing) 

CUSTOM CALLIGRAPHY CAN BE ADDED TO ONE OR BOTH SIDES - CHOOSE OPTION OF YOUR CHOICE IN DROP-DOWN MENU.


THIS IS A MEDIUM-SIZED GLOBE
HEIGHT: About 11 inches
WIDTH: About 9 inches
DIAMETER: 8.25 inches
COLOR: White and Gold with shaded continents 
🌿NOTE:  (Gold base can vary somewhat in color due to vendor, but will still be gold/burnished gold and any small markings in the base of the stand are not imperfections...they are natural to the product to add to the vintage nature of this globe style)

