UPDATES:
// Font name changed from &quot;Tolkien&quot; and now should be listed in your programs as &quot;Legendarium Script&quot;
//

By studying the illustrations, cartographies, and penmanship of author J.R.R. Tolkien, I designed a digital script typeface based off his handwriting. I created upper and lowercase as well as numbers, punctuation, ligatures, and multi-lingual characters. There is no Bold or Italic options included.

// Thank you all for the support! This is an evolving font project so feedback is appreciated! I plan to expand this font with alternates, serif caps, and revise the existing letters. So stay tuned!

FULL ALPHABET FONT WITH SPECIAL CHARACTERS

This is a digital file only. No physical items will be shipped.

Files will be available for download immediately after payment is completed.

Your Zip file will contain a .ttf file and terms of use.

This font works with any application such as Microsoft office programs, Adobe programs, and many others.

Because of the digital nature of these products, no refunds will be given.

Please contact me if you have any trouble downloading and installing the font on your computer.

